      return selectedOptions.some(optionNode =>
        matcher(getNodeText(optionNode), optionNode, value, matchNormalizer),
      )
    } else {
      return matcher(
        (node as HTMLInputElement).value,
        node,
        value,
        matchNormalizer,
      )
    }
  })
}

